import React from 'react';
import { Form, Input, Button } from 'antd';

const Home = () => {
  return (
    <div style={{ 
      backgroundImage: 'url(https://izcelikyapi.com/wp-content/uploads/2022/05/iki-katli-celik-ev-modelleri.webp)', 
      height: '100vh', 
      backgroundSize: 'cover', 
      backgroundPosition: 'center', 
      display: 'flex', 
      justifyContent: 'center', 
      alignItems: 'center',
      width: '100vw'
    }}>
      <Form layout="inline" style={{ background: 'rgba(0, 0, 0, 0.5)', padding: '20px', borderRadius: '10px' }}>
        <Form.Item>
          <Input placeholder="Tür" />
        </Form.Item>
        <Form.Item>
          <Input placeholder="İl" />
        </Form.Item>
        <Form.Item>
          <Input placeholder="İlçe" />
        </Form.Item>
        <Form.Item>
          <Input placeholder="Oda Sayısı" />
        </Form.Item>
        <Form.Item>
          <Button type="primary">Search</Button>
        </Form.Item>
      </Form>
    </div>
  );
};

export default Home;
